B.CP=A.a(s(["What I see in your handwriting is that you have a fear of success. This means sometimes, you go too close to success but eventually fail because of the fear of change or discomfort. Because success needs and brings change and it might sometimes impact your comfort.","Example: If there is any event that's going against your comfort (mismatched time, distant place), you may want to skip it to avoid that discomfort zone. You might not be that flexible in extending or sharing your comfort zone with others.","The closer you come towards success and then turn away.","Once the feeling of dejection occurs, you will get very close to success and then fail."]),t.s)
